import React, {Component} from 'react';

class Item extends Component{
    render(){
        const {todo} = this.props;
        return(
            <div>
                <div>{todo.user_id}와 {todo.password}입니다.</div>
                <div>
                    <input value={todo.user_id} />
                    <br/>
                    <input value={todo.password} />
                </div>
                <button>수정하기</button>
                <br/>
            </div>

        )
    }
}

export default Item;
